(1, 'Mojotengah', 'Blederan', '110014', 'Kampung Sayur Organik', 'logo_blederan.svg', '#00A79D', 1, '<p><strong> A. Asal Usul Pembentukan Desa </strong></p>\r\n<p> </p>\r\n<p>Desa Blederan berdiri pada tahun yang tidak diketahui sejarahnya, diperkirakan berdiri setelah terjadi perang Diponegoro melawan Belanda dan sebelum Indonesia merdeka tahun 1945, hal ini berdasar dari cerita bahwa Lurah pertama di Desa Blederan di ketahui tahun 1912.</p>\r\n<p> </p>\r\n<p>Pemerintah Desa Blederan sampai saat ini belum menemukan dokumen dan bukti sejarah yang menyebutkan kapan tahun berdirinya Desa Blederan. Sejarah Desa Blederan hanya dapat di telusuri melalui cerita lisan yang berkembang secara turun temurun di tengah masyarakat khususnya tokoh sepuh masyarakat, bahwa Lurah pertama Desa Blederan berasal dari Yogyakarta.</p>\r\n<p> </p>\r\n<p>Menurut cerita dari Bapak Bahrudin selaku tokoh sepuh Desa Blederan dan juga mantan Bau/Kadus Dusun Blederan menerangkan bahwa Desa Blederan pada awalnya masuk wilayah Kecamatan Garung dan sejak tahun 1935 masuk wilayah Kecamatan Mojotengah. Di ceritakan pula bahwa Desa Blederan pada awalnya merupakan tempat musyawarah untuk menyusun strategi perang dan sebagai tempat untuk berlaga/perang adalah di Dusun Klesman.</p>\r\n<p> </p>\r\n<p>Sejarah ini ditulis berdasarkan cerita secara turun temurun, dan salah satu narasumber yang menjadi rujukan penulisan sejarah Desa Blederan adalah mantan Bau/Kadus Dusun Blederan periode 1972 – 2005 yaitu Bapak Bahrudin yang lahir di Wonosobo pada tanggal 5 April 1930, yang menceritakan sejarah Desa Blederan kepada Sekdes Blederan periode sekarang yaitu Bapak Masrukhin.</p>\r\n<p> </p>\r\n<p><strong> B. Pemimpin Desa </strong></p>\r\n<p> </p>\r\n<p><strong> 1. RADEN KARTA DIMEJA : Periode Sampai Tahun 1912 </strong></p>\r\n<p> </p>\r\n<p>Raden Karta Dimeja berasal dari Yogyakarta keturunan bangsawan kraton, Beliau merupakan Lurah pertama Desa Blederan, pada masanya di Desa Blederan terdapat perwakilan Kantor Bank milik Negara, untuk kondisi desa belum tertata dengan baik.</p>\r\n<p> </p>\r\n<p><strong> 2. RADEN DANU SUWONDO : Periode 1912 – 1926 </strong></p>\r\n<p> </p>\r\n<p>Raden Danu Suwondo adalah putra dari Raden Karta Dimeja, Beliau menjadi Lurah karena menggantikan Ayahnya. Pada masa itu kondisi Desa Blederan juga belum tertata dengan baik. Adapun Carik pada waktu itu adalah Bapak Tarmorejo, Beliau adalah Ayah dari Bapak Bahrudin.</p>\r\n<p> </p>\r\n<p><strong> 3. NGARADI : Periode 1926 – 1930 </strong></p>\r\n<p> </p>\r\n<p>Pada waktu Lurah Ngaradi kondisi Desa Blederan juga belum tertata dengan baik dan untuk carik pada waktu itu masih di jabat oleh Bapak Tarmorejo.</p>\r\n<p> </p>\r\n<p><strong> 4. MINHAD : Periode 1930 – 1932 </strong></p>\r\n<p> </p>\r\n<p>Pada waktu Lurah Minhad kondisi Desa Blederan juga belum tertata dengan baik. Adapun Carik pada waktu itu masih di jabat oleh Bapak Tarmorejo.</p>\r\n<p> </p>\r\n<p><strong> 5. H. DAHLAN : Periode 1932 – 1950 </strong></p>\r\n<p> </p>\r\n<p>Pada waktu Lurah H. Dahlan kondisi Desa Blederan sudah mulai merintis pembangunan desa dengan mulai di rintis pembuatan jalan setapak. Adapun Carik masih di jabat oleh Bapak Tarmorejo.</p>\r\n<p> </p>\r\n<p><strong> 6. SAKDUN : Periode 1950 – 1959 </strong></p>\r\n<p> </p>\r\n<p>Lurah Sakdun lahir di Wonosobo pada tahun 1920, pada waktu Lurah Sakdun kondisi Desa Blederan melanjutkan program dari Lurah H. Dahlan yaitu pembuatan jalan setapak dan pelebaran dan pembuatan jalan lingkungan Dusun Klesman sebelah utara, dimulainya pembuatan lapangan desa dan secara bertahap Desa Blederan sudah mulai tertata dengan baik dan dimulainya pembuatan jembatan masuk Dusun Klesman Desa Blederan. Adapun Carik pada waktu itu di jabat oleh Bapak Muhtar.</p>\r\n<p> </p>\r\n<p><strong> 7. SAKDULLAH : Periode 1959 – 1976 </strong></p>\r\n<p> </p>\r\n<p>Lurah Sakdullah lahir di Wonosobo pada tahun 1929, kondisi Desa Blederan mulai tertata, hal tersebut dibuktikan dengan pembuatan jembatan yang dilanjutkan, hal ini bukti bahwa pembangunan desa sudah mulai di rencanakan. Pada jamannya mulai dirintis adanya Pasar Desa dan lokasinya masih di pinggir jalan. Adapun Carik pada waktu itu di jabat oleh Bapak Samsuhadi dan selanjutnya sejak tahun 1972 jabatan Carik di jabat oleh Bapak Safrudin.</p>\r\n<p> </p>\r\n<p><strong> 8. AHMAD AFANDI : Periode 1976 – 1989 </strong></p>\r\n<p> </p>\r\n<p>Kepala Desa Ahmad Afandi lahir di Wonosobo pada tanggal 2 Mei 1944 Kondisi Desa Blederan sudah mulai, perencanaan pembangunan sudah mulai tersusun dan musyawarah dijalankan, hal ini dibuktikan dengan di bangunnya Kantor Desa di Dusun Klesman sebagai pusat pemerintahan Desa Blederan, adanya Listrik masuk desa dan pembuatan jalan lingkungan yang menghubungkan antar Rukun Warga dalam satu wilayah dusun. Kondisi Pasar Desa pada waktu itu sudah menempati lokasi di tanah bengkok. Carik masih di jabat oleh Bapak Safrudin, Lurah dan Carik bahu membahu dalam merencanakan dan melaksanakan pembangunan di desa, pembuatan lapangan sepak bola di lanjutkan dengan cara swadaya dari masyarakat dan juga pembangunan-pembangunan seperti pelebaran jalan lingkungan.</p>\r\n<p> </p>\r\n<p><strong> 9. RETNO HARINI : Periode 1989 – 1998 </strong></p>\r\n<p> </p>\r\n<p>Kepala Desa Retno Harini lahir di Wonosobo pada tanggal 24 Juli 1959. Pada waktu itu perencanaan pembangunan mulai tersusun, kelembagaan desa sudah terbentuk seperti : LKMD, Karang Taruna, RT dan RW. Musyawarah pembangunan desa mulai di jalankan dengan melibatkan unsur-unsur masyarakat. Sekdes pada waktu itu masih di jabat oleh Bapak Safrudin. Pada masanya berdiri Pasar Desa yang berlokasi di Jawar sehingga sampai sekarang di sebut Pasar Jawar. Kegiatan desa seperti peringatan HUT RI dilakanakan secara meriah dengan melibatkan warga masyarakat. Pada saat itu juga pernah dilaksanakan lomba desa tingkat kecamatan dan kabupaten.</p>\r\n<p> </p>\r\n<p><strong> 10. MUTTAQIN : Periode 1998 – 2006 </strong></p>\r\n<p> </p>\r\n<p>Kepala Desa Muttaqin lahir di Wonosobo pada tanggal 19 Nopember 1972 dan Sekdes masih di jabat oleh Bapak Safrudin dan tahun 1999 jabatan Sekdes di pegang oleh Bapak Masrukhin sampai sekarang. Pada masanya kondisi Desa Blederan mulai di tata mulai dari perenicanaan dan pelaksanaan pembangunan, kelembagaan desa di tumbuhkembangkan menjadi bagian yang berpartisipasi dalam pembangunan desa. Lahirnya Undang-Undang Nomor 32 Tahun 2004 membawa konsekuensi bagi Desa Blederan untuk melengkapi segala hal yang terkait dengan penyelenggaraan jalannya Pemerintahan Desa, dimulai dari penataan Pemerintah Desa dan Kelembagaannya dan juga adanya Badan Permusyawaran Desa (BPD) sebagai satu kesatuan dengan pemerintah desa menjalankan pemerintahannya. Pembangunan mulai di galakkan dari mulai rollag dan betonisasi jalan lingkungan, perbaikan jalan rotocol, senderan jalan protocol, rehab kantor desa dan pembuatan gedung serba guna, rehab pasar desa, pembenahan saluran irigasi, pembuatan jembatan tembus dan pengadaan air bersih Dusn Klesman dan Dusun Blederan. Adapun prestasi yang diraih pada waktu itu adalah : Pelunasan PBB sebelum jatuh tempo, Juara 1 Lomba Kantor Desa tingkat kecamatan, Juara 2 Lomba Desa tingkat kabupaten.</p>\r\n<p> </p>\r\n<p><strong> 11. H.M.MUTTAQIN : Periode 2006 – 2012 </strong></p>\r\n<p> </p>\r\n<p>Kepala Desa H.M.Muttaqin merupakan mantan Kepala Desa yang mencalonkan kembali dan terpilih untuk periode yang kedua. Pada masa kepemimpinannya telah banyak perubahan yang terjadi dari mulai pengaspalan jalan protocol dan betonisasi jalan lingkungan. Adapun prestasi yang di raih dari tingkat kecamatan dan tingkat kabupaten diantaranya : Juara 2 lomba Kantor Desa tingkat Kecamatan, Juara 1 terbaik pengelolaan ADD tingkat Kecamatan, mewakili Kabupaten Wonosobo lomba desa tingkat propinsi dan lomba pengelolaan PUAP terbaik, pemasangan jaringan internet untuk masyarakat, Juara 2 Lomba perpustakan tingkat kabupaten, Juara 1 Lomba perpustakaan tingkat kabupaten, Juara 1 Lomba perpustakaan desa tingkat propinsi, dan berbagai piala hasil kejuaran sepak bola tingkat kabupaten . Selain prestasi tersebut pada masanya telah dikedepankan transparansi di bidang pemerintahan, di selenggarakannya musyawarah dari mulai tingkat dusun sampai ke tingkat desa dengan melibatkan unsur yang ada di masyarakat secara partisipatif dan apresiatif.</p>\r\n<p> </p>\r\n<p><strong> 12. YUDI CAHYADI : Periode 2012 – 2018 </strong></p>\r\n<p> </p>\r\n<p>Kepala Desa Yudi Cahyadi lahir di Wonosobo pada tanggal 2 Desember 1982, pada saat sekarang ini melanjutkan program kegiatan pembangunan desa dari pemerintahan sebelumnya. Adanya Undang-Undang Nomor 6 tahun 2014 tentang Desa yang mana salah satu amanat UUDesa adalah dana yang besar yang bersumber dari APBN langsung ke desa, sehingga dengan dana yang besar memungkinkan desa untuk berbuat lebih banyak lagi untuk meningkatkan penyelenggaraan pemerintahan dan melaksanakan pembangunan di segala bidang. Betonisasi jalan lingkungan, senderan jalan dan irigasi, rehab pasar desa, pembuatan gapura desa, hal tersebut merupakan wujud nyata pembangunan di desa. Dan di tahun 2013 meraih juara 1 bidang otonomi desa tingkat Kabupaten Wonosobo sebagai Desa Hebat 2013.</p>', 'sejarah_blederan.jpg', 1, '<p><strong>A. Batas Wilayah</strong> <br>Batas Wilayah Desa Blederan Kecamatan Mojotengah sebagai berikut : <br>1. Sebelah Utara : berbatasan dengan Desa Sendangsari Kecamatan Garung <br>2. Sebelah Timur : berbatasan dengan Desa Gemblengan Kecamatan Garung <br>3. Sebelah Selatan : berbatasan dengan Desa Bumirejo Kecamatan Mojotengah <br>4. Sebelah Barat : berbatasan dengan Desa Wonokromo Kecamatan Mojotengah <br><strong>B. Peruntukan Lahan</strong> <br>Wilayah Desa Blederan sebagian besar merupakan tanah garapan berupa tanah sawah seluas 67 ha, dan sebagian kecil berupa tanah tegalan seluas 18 ha, pemukiman 22 ha, dengan hasil utama berupa padi dan sebagian sayuran berupa kobis, tomat dan cabe.</p>', 'peta_blederan.jpg', 1, 0, 1, 1, 1, 'bg-blederan-1.jpg', 'bg-blederan-2.jpg', 'bg-blederan-1.jpg', 'bg-blederan-2.jpg', 'bg-blederan-1.jpg', 'bg-blederan-2.jpg', 'bg-blederan-1.jpg', 'bg-blederan-2.jpg', 'bg-blederan-1.jpg', 'Pesona Blederan', 'desa_blederan', 'Desa Blederan', NULL, 'https://www.facebook.com/pesona.blederan', 'https://www.instagram.com/desa_blederan?utm_source=ig_web_button_share_sheet&igsh=ZDNlZDc0MzIxNw==', 'https://x.com/DBlederan', NULL, '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7914.758897816177!2d109.90955559482768!3d-7.31119937915195!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e700a91c52ab135%3A0x2507636147492a01!2sBlederan%2C%20Mojotengah%2C%20Wonosobo%20Regency%2C%20Central%20Java!5e0!3m2!1sen!2sid!4v1733103943522!5m2!1sen!2sid\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '<iframe src=\"https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d7903.077052066978!2d110.48409014485892!3d-7.9431673423958555!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x2e7a52c5991ffded%3A0xdb3cb79cbaf06442!2sKantor%20Desa%20Bleberan!5e0!3m2!1sen!2sid!4v1733103984793!5m2!1sen!2sid\" width=\"600\" height=\"450\" style=\"border:0;\" allowfullscreen=\"\" loading=\"lazy\" referrerpolicy=\"no-referrer-when-downgrade\"></iframe>', '2024-11-20 19:11:42', '2024-12-01 22:47:03'),
